var mqttHook = [
    //Falls die Waschmaschine einfach an ein bestimmtes Topic eine Nachricht sendet, wenn sie fertig ist
    {
      mqttTopic: "myhome/mywasher/finished",
      mqttPayload: [
        {
          mqttNotiCmd: ["WasherFinished"]
        },
      ],
    },
    //Falls die Waschmaschine ihren Status an ein bestimmtes Topic sendet (z.B. "running", "finished", etc.)
    {
      mqttTopic: "myhome/mywasher/state",
      mqttPayload: [
        {
          payloadValue: "finished",
          mqttNotiCmd: ["WasherFinished"]
        },
      ],
    },
    //Falls die Waschmaschine ihren Status als JSON-Objekt an ein bestimmtes Topic sendet. z.B.
    //{ "type": "washer", "serial": 123567, "state": "finished"}
    {
      mqttTopic: "myhome/mywasher/jsonState",
      mqttPayload: [
        {
          jsonpath: "state",
          payloadValue: "finished",
          mqttNotiCmd: ["WasherFinished"]
        },
      ],
    },

    //Egal welcher der drei Fälle für dich zutrifft. Es wird immer der Command "WasherFinished" unten getriggert
  ];
var mqttNotiCommands = [
    {
      commandId: "WasherFinished",
      //Sende eine Notification "SHOW_ALERT"
      notiID: "SHOW_ALERT",
      //Die Payload der Notification soll wie folgt sein...
      notiPayload: {title: "Waschmaschine", message: "Waschmaschine ist fertig", timer: 3600000}
      //Der Alert hat also als Title "Waschmaschine", es wird die Nachricht "Waschmaschine ist fertig" angezeigt und wenn der Alert nicht mit einer "HIDE_ALERT" Notification (z.B. durch den TouchButton) vorher entfernt wird passiert es automatisch nach einer Stunde (3600s, was 3600000ms sind)
    },
  ];

  module.exports = { mqttHook,  mqttNotiCommands};

