using namespace std;

bool isDuplicate(string s) {
    for(int i=0; i<s.size(); i++) {
        int flag=0;
        for(int j=i+1; j<s.size(); j++) {
            if(s.substr(i,1)==s.substr(j,1)) {
                ++flag;
            }
            if(flag==1) {
                return 1;
            }
        }
    }
    return 0;
}

int lengthOfLongestSubstr(string s) {
    string str;
    for(int i=0; i<s.size(); i++) {
        for(int j=s.size()-i; j>str.size(); j--) {
            string tmp=s.substr(i, j);
            if(isDuplicate(tmp)) {
                continue;
            } else if( tmp.size()>str.size() ) {
                str=tmp;
                break;
            }
        }
    }
    return str.size();
}

